window.bookSummaryJSON = "<p>If anyone can hide a secret, she can.</p> <p>When Hazel Hardy returns to her family's New England hometown and decides the quaint village with stone bridges and tree-lined streets is the perfect place for her new teashop, she doesn’t worry that long-ago residents killed her great, great, something grandmother for being a witch. Or that the town’s attitudes toward witchery haven’t changed much. She swears she won’t stir up trouble…in a cauldron or otherwise. But then she becomes involved in a murder, and witchcraft could really come in handy.</p> <p>Real trouble shows up when she meets the charming police chief, who doesn’t like witches and who doesn’t hide his attraction to her. Worse, she’s brewing a crush on him, too, and she finds she adores searching for clues to help him solve the case. She convinces herself she’ll be fine as long as they find the murderer before she accidently uses magic again.</p> <p>Buy<i> Once Wicked</i> today to immerse yourself in murder, magic, and mayhem!</p> <p><i>Once Wicked</i> is the first book in the Teas and Temptations Cozy Mystery series. If you like lighthearted paranormal mysteries with a fun romance, then you’ll love Cindy Stark’s mystical adventures!</p> <p><b>Note: Does not contain gore, swearing, or adult-situations. Suitable for teens to adults.</b></p>"; 
